import emoji from "react-easy-emoji";

const user_name = {
    title1 : "ミル",
    title2 : "コマ",
    content : "私たちとつながって、さらに詳しく調べてください。",
    next : "行こう",
    noMember : "会員ではありませんか？",
    register : "今すぐ登録",
    username_placeholder : "ユーザー名",
}
export {
    user_name
};
